import { LazyImage } from 'components'
import React from 'react'
import styles from './CreditTips.less'

export interface CreditTipsProps {
  creditData:any
}

const CreditTips: React.FunctionComponent<CreditTipsProps> = ({}) => {
  return (
    <div className={styles.CreditTips}>
      <div className={styles.creditInfo}>
        <LazyImage className={styles.creditIcon} src={'https://img2.xianghuanji.com/image/product/b0d6244e8162ba8d82b695b91ce5efc0d29dff6d.png'} alt="" />
        <span className={styles.creditTitle}>您已选择信用评估免押</span>
      </div>
      <p className={styles.creditDesc}>信用好可全免押金</p>
    </div>
  )
}

export default CreditTips
